create table Stats
(
    ID        bigint unsigned auto_increment
        primary key,
    PlayerID  bigint unsigned not null,
    PlayTime  longtext        not null,
    FirstJoin datetime(6)     not null,
    LastJoin  datetime(6)     not null,
    constraint IX_Stats_PlayerID
        unique (PlayerID),
    constraint FK_Stats_Players_PlayerID
        foreign key (PlayerID) references Players (ID)
            on delete cascade
);

